import "../../assets/css/main.css"
import "../../assets/css/style.css"
import { Link } from 'react-router-dom';

function homeServiceBox(props){
    return (
        <Link to={proplink} className="homeServiceBox">
            <article className="homeServiceBoxThumbnail"></article>
            <article className="homeServiceBoxDetails">
                <h3>Chronic Pain</h3>
                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit.</p>
                <article className="homeServiceBoxBtn">Explore More</article>
            </article>
        </Link>
    );
}

export default homeServiceBox;
